create database HeartAttackPrediction character set utf8mb4 collate utf8mb4_unicode_ci;

create table Pacientes(
Patient_ID varchar(30) primary key,
Age varchar(30),
Sex varchar(30),
Cholesterol varchar(30),
Blood_Pressure varchar(30),
Heart_Rate varchar(30),
Diabetes int,
Family_History int,
Smoking int,
Obesity int,
Alcohol_Consumption int,
Exercise_Hours_Per_Week varchar(40),
Diet varchar(30),
Previous_Heart_Problems int,
Medication_Use int,
Stress_Level varchar(30),
Sedentary_Hours_Per_Day varchar(40),
Income varchar(30),
BMI varchar(30),
Triglycerides varchar(40),
Physical_Activity_Days_Per_Week varchar(100),
Sleep_Hours_Per_Day varchar(10),
Country varchar(20),
Continent varchar(20),
Hemisphere varchar(30),
Heart_Attack_Risk int
);
use HeartAttackPrediction;
drop table Pacientes;
select * from Pacientes;

